'233','0','open','https://git155.dreamhosters.com/?p=233','0','open','','1','<!-- wp:heading {\"align\":\"center\"} -->\n<h2 class=\"has-text-align-center\">BLOG</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":244,\"width\":348,\"height\":232,\"sizeSlug\":\"large\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-large is-resized is-style-default\"><img src=\"https://git155.dreamhosters.com/wp-content/uploads/2020/09/download-2.jpeg\" alt=\"\" class=\"wp-image-244\" width=\"348\" height=\"232\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"align\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\">Dry Cut</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Dry cut is a technique performed on completely dry hair that enables the stylist to look at the hair sits naturally. By cutting the hair in a dry condition opposed to wet, the stylist can assess its shape, movement, texture and volume easily.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Itâ€™s also easy for you to imagine your finished look. This is because when hair is wet it becomes elastic and does not sit the same way after you go back home to try and recreate the style. The hair cut last longer because it causes less damage and keeps your hair looking better for longer.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->','','2020-09-16 17:07:11','2020-09-16 17:07:11','','','2020-09-16 17:07:11','2020-09-16 17:07:11','__trashed','0','','trash','','post',''),(
