'298','0','closed','https://git155.dreamhosters.com/284-revision-v1/','0','closed','','1','<!-- wp:image {\"align\":\"center\",\"id\":285,\"width\":310,\"height\":206,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"https://git155.dreamhosters.com/wp-content/uploads/2020/09/download-1-1-2.jpeg\" alt=\"\" class=\"wp-image-285\" width=\"310\" height=\"206\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Henna (Herbal treatment) is a natural colorant and strengthener with no chemical. It will help strengthen and manage damaged hair and make your hair full, glossy and healthy. Henna covers your grey hair naturally and makes your hair strong and shiny. Colour comes in Clear, Red, Blue, Dark Brown, Burgundy and Black.</p>\n<!-- /wp:paragraph -->','','2020-09-17 02:07:39','2020-09-17 02:07:39','','','2020-09-17 02:07:39','2020-09-17 02:07:39','284-revision-v1','284','','inherit','HENNA HERBAL TREATMENT','revision',''),(
