'300','0','closed','https://git155.dreamhosters.com/276-revision-v1/','0','closed','','1','<!-- wp:image {\"align\":\"center\",\"id\":277,\"width\":310,\"height\":206,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"https://git155.dreamhosters.com/wp-content/uploads/2020/09/download-4-4.jpeg\" alt=\"\" class=\"wp-image-277\" width=\"310\" height=\"206\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Dry cut is a technique performed on completely dry hair that enables the stylist to look at the hair sits naturally. By cutting the hair in a dry condition opposed to wet, the stylist can assess its shape, movement, texture and volume easily.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Itâ€™s also easy for you to imagine your finished look. This is because when hair is wet it becomes elastic and does not sit the same way after you go back home to try and recreate the style. The hair cut last longer because it causes less damage and keeps your hair looking better for longer.</p>\n<!-- /wp:paragraph -->','','2020-09-17 02:11:25','2020-09-17 02:11:25','','','2020-09-17 02:11:25','2020-09-17 02:11:25','276-revision-v1','276','','inherit','DRY CUT','revision',''),(
